import React from "react";

const TableBody = (props) => {
    console.log(props);
  return (
    <>
      <tbody>
      {
        props.data.map((it,index)=>{
            return(
                <tr key={index}>
                <td> </td>
                    
            </tr>);
        })
      }
      </tbody>
    </>
  );
};

export default TableBody;
